import React, { useState } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';

// Styled Components
const PageContainer = styled.div`
  padding: 120px 5% 80px;
  min-height: 100vh;
  max-width: 1200px;
  margin: 0 auto;
`;

const PageTitle = styled.h1`
  font-size: 2rem;
  font-weight: 400;
  margin-bottom: 30px;
  color: ${props => props.theme.colors.primary};
`;

const ModelsContainer = styled.div`
  margin-bottom: 60px;
`;

const ModelRow = styled.div`
  display: flex;
  align-items: center;
  padding: 30px 0;
  border-bottom: 1px solid #e0e0e0;
  position: relative;
  
  &:first-child {
    border-top: 1px solid #e0e0e0;
  }
`;

const ModelNameLabel = styled.div`
  font-size: 2.5rem;
  font-weight: 500;
  color: ${props => props.theme.colors.primary};
  width: 120px;
  flex-shrink: 0;
`;

const ModelImage = styled.div`
  flex: 1;
  display: flex;
  justify-content: center;
  height: 160px;
  margin: 0 20px;
  
  img {
    height: 100%;
    object-fit: contain;
  }
`;

const SelectionContainer = styled.div`
  width: 80px;
  display: flex;
  justify-content: flex-end;
  align-items: center;
`;

const RadioButton = styled.input`
  appearance: none;
  width: 24px;
  height: 24px;
  border: 2px solid #333;
  border-radius: 50%;
  margin: 0;
  position: relative;
  cursor: pointer;
  
  &:checked {
    &:after {
      content: "";
      position: absolute;
      top: 4px;
      left: 4px;
      width: 12px;
      height: 12px;
      border-radius: 50%;
      background: #333;
    }
  }
  
  &:focus {
    outline: none;
  }
`;

const ModelLabel = styled.label`
  font-size: 1rem;
  color: ${props => props.theme.colors.primary};
  margin-left: 10px;
  cursor: pointer;
`;

const ButtonContainer = styled.div`
  position: absolute;
  right: -220px;
  top: 50%;
  transform: translateY(-50%);

  @media (max-width: ${props => props.theme.breakpoints.tablet}) {
    position: static;
    transform: none;
    margin-top: 20px;
    margin-left: auto;
    width: 200px;
  }
`;

const SelectButton = styled.button`
  background-color: #102B4E;
  color: white;
  font-size: 0.875rem;
  font-weight: 600;
  padding: 15px 30px;
  border: none;
  text-transform: uppercase;
  letter-spacing: 1px;
  transition: all 0.3s ease;
  display: flex;
  align-items: center;
  justify-content: center;
  white-space: nowrap;
  cursor: pointer;
  
  &:after {
    content: 'â†’';
    font-size: 1.2rem;
    margin-left: 10px;
  }
`;

interface ModelType {
  id: string;
  name: string;
  displayName: string;
  variant?: string;
  image: string;
}

const TestDrivePage: React.FC = () => {
  const [selectedModel, setSelectedModel] = useState<string | null>(null);
  const navigate = useNavigate();
  
  const models: ModelType[] = [
    { id: 'lbx', name: 'LBX', displayName: 'LBX', image: '/images/lexus_lbx.png' },
    { id: 'ux', name: 'UX', displayName: 'UX', variant: '300h', image: '/images/lexus_ux.png' },
    { id: 'rz', name: 'RZ', displayName: 'RZ', image: '/images/lexus_rz.png' },
    { id: 'nx', name: 'NX', displayName: 'NX', image: '/images/lexus_nx.png' },
    { id: 'rx', name: 'RX', displayName: 'RX', image: '/images/lexus_rx.png' },
    { id: 'es', name: 'ES', displayName: 'ES', image: '/images/lexus_es.png' },
    { id: 'ls', name: 'LS', displayName: 'LS', image: '/images/lexus_ls.png' },
  ];
  
  const handleSelectCar = (modelId: string) => {
    alert(`Bedankt voor het kiezen van de ${models.find(m => m.id === modelId)?.displayName}. Een Lexus-vertegenwoordiger zal binnenkort contact met u opnemen om uw proefrit te plannen.`);
    navigate('/experience');
  };
  
  return (
    <PageContainer>
      <PageTitle>In welk model wilt u proefrijden?</PageTitle>
      
      <ModelsContainer>
        {models.map(model => (
          <ModelRow key={model.id}>
            <ModelNameLabel>{model.name}</ModelNameLabel>
            <ModelImage>
              <img src={model.image} alt={model.name} />
            </ModelImage>
            <SelectionContainer>
              <RadioButton 
                type="radio" 
                id={model.id}
                name="carModel"
                checked={selectedModel === model.id}
                onChange={() => setSelectedModel(model.id)}
              />
              <ModelLabel htmlFor={model.id}>
                {model.displayName} {model.variant && model.variant}
              </ModelLabel>
            </SelectionContainer>
            
            {selectedModel === model.id && (
              <ButtonContainer>
                <SelectButton onClick={() => handleSelectCar(model.id)}>
                  KIES DEZE AUTO
                </SelectButton>
              </ButtonContainer>
            )}
          </ModelRow>
        ))}
      </ModelsContainer>
    </PageContainer>
  );
};

export default TestDrivePage;
